import React, { Component } from 'react';

export default class GroceryCard extends Component {
    state = {
        clicker: 1
    }
    render(){
        const { title, picture} = this.props.grocery
        return(
            <div className="ingredient-card">
                <img src={picture} alt=""></img>
                <div>
                <h3>{title}</h3>
                <button className="button">-</button><button className="button">+</button>
                <br></br>
                <p>Quantity: {this.state.clicker}</p>
                </div>
            </div>
        )
    }
}
